    'локус': 'Локус - 1) участок ДНК (хромосомы), где расположена определённая генетическая детерминанта 2) характеристика личности, определяющая склонность приписывать свои успехи или неудачи внутренним либо внешним факторам 3) книжн. место или точка в пространстве 4) в трёхмерной системе координат, образующей цветовое пространство, — геометрическое место точек цветности монохроматических излучений',
    'обнос': 'Обнос - 1) действие по значению гл. обносить, обнести. 2) спец. нависающая, поддерживаемая кронштейнами часть палубы речного судна. ',
    'колоб': 'Колоб - круглый хлеб, хлебец',
    'букс': 'Букс - вечнозелёный декоративный кустарник или невысокое ветвистое южное дерево; самшит. ',
    'откол': 'Откол - 1) действие по значению гл. откалывать, откалываться. 2) результат такого действия; то, что отделилось, отбилось от целого. ',
    'усы': 'Усы - 1) волосы (или волоски), растущие над верхней губой у мужчин 2) щетинообразные волосы по бокам верхней губы у некоторых животных, служащие органом осязания 3) ботан. тонкие побеги, стебельки некоторых растений, которые служат для их размножения или для прикрепления к чему-нибудь ',
    'соул': 'Соул - один из стилей американской поп-музыки, основанный на музыкально-танцевальных традициях негритянского фольклора.',
    'рапид': 'Рапид - 1) скоростная киносъёмка с частотой до нескольких сотен или тысяч кадров в секунд 2) разновидность игры в шахматы, где каждому игроку на всю партию даётся больше 10 минут, но меньше часа 3) гоночная машина, спорткар 4) сплав, материал наконечников быстрорежущих инструментов с высоким содержанием вольфрама',
    'сидор': 'Сидор - солдатский вещевой мешок ',
    'стома': 'Стома - 1) В анатомии - отверстие рта или какая-либо часть, по своему внешнему виду напоминающая такое отверстие. 2) В хирургии - искусственно созданное отверстие какого-либо полого органа (например, ободочной или подвздошной кишки), которое выводится наружу через брюшную стенку ',
    'власти': 'Власти - лица, облечённые правительственными, административными полномочиями',
    'сетование': 'Сетование - 1) Действие по гл. сетовать. 2) Жалоба.',
    'тесание': 'Тесание - отделение коры от массива древесины - используется только при обработке кряжей, пластин и четвертей. Операция выполняется с помощью топора, причем движения им должны быть направлены от вершины к основанию. ',
    'подсека': 'Подсека - 1) Вырубленное, очищенное для пашни место в лесу. 2) Подсечная система земледелия.',
    'шпор': 'Шпор - морск. основание, нижний конец мачты, стеньги и т. п. Когда прилив достиг наивысшей точки, шпоры мачт проломили днище и вода хлынула внутрь судна',
    'куна': 'Куна - 1) денежная единица Древней Руси 2) денежная единица Хорватии',
    'неук': 'Неук - 1) Невыезженная лошадь 2) Невежда, неуч ',
    'ненка': 'Ненка - представительница народа ненцев. Ненцы - Народ, относящийся к коренному населению Ненецкого, Ямало-Ненецкого и Таймырского округов [прежнее название - самоеды]',
    'удол': 'Удол - 1) Низкое место между горами; долина 2) низменность под уступом, низина, низы; равнина под венцом или степным, матерым кряжем',
    'друз': 'Друз - 1) представитель этноконфессиональной группы в Ливане, Сирии, Иордании и в Израиле 2) Представитель народности, живущей в Сирии и говорящая по-арабски',
    'втирание': 'Втирание - 1) действие по глаголу втереть 2) Втираемая мазь, состав. Врач назначил втирание',
    'тернии': 'Тернии - 1) шипы, препятствия, подводные камни 2) Любые опасности, препятствия. Через тернии к звёздам',
    'партита': 'Партита - 1) род органных вариаций на хоральную мелодию в музыке XVII—XVIII веков 2) разновидность сюиты или концертная сюита — циклическая форма, состоящая из пяти и более частей. Отличие от сюиты заключается в наличии прелюдийной части перед аллемандой (фантазией), а также в появлении так называемых «вставных» частей цикла: гавот, полонез, бурре, менуэт, бурлеска, скерцо, ария и т. д., призванных смягчить темповый контраст между основными частями сюиты, составляющими «каркас» цикла: аллеманда, куранта, сарабанда и жига. Количество, порядок и жанровая основа «вставных» номеров не стабильны и могут варьироваться.',
    'скол': 'Скол - 1) действие по значению гл. скалывать, сколоть 2) место, где скололся кусок чего-либо; место разлома хрупкого объекта 3) то, что сколото, сколотый кусок чего-либо',
    'сип': 'Сип - 1) Сипота, осиплость. Сип в горле 2) Сиплый, сипящий звук. Раздался неясный сип. 3) Хищная птица сем. ястребиных',
    'пески': 'Пески - большие пространства, покрытые песком',
    'донатор': 'Донатор - 1)Дона́тор (от лат. donator «даритель») — заказчик произведений изобразительного искусства или архитектурного сооружения 2) в западноевропейском искусстве средневековья и Возрождения (а иногда и в искусстве более позднего времени) изображение заказчика, иногда строителя храма (часто с моделью здания в руках) или заказчика произведения живописи (реже скульптуры и декоративно-прикладного искусства). Донатор обычно изображался предстоящим перед Христом и Богоматерью или святыми',
    'донат': 'Донат - 1) ценный дар или денежное пожертвование на какие-либо цели, в поддержку кого-либо, чего-либ 2) истор. кандидат в члены рыцарского ордена, обязавшийся совершить паломничество на Святую землю за свой счёт 3)  нумизм. знак ордена святого Иоанна Иерусалимского, установленый в 1798 году Павлом I для нижних воинских чинов Российской империи 4) Пончик',
    'шора': 'Шора - 1) крупный песок, хрящ, дресва 2) индейка, индюшка, пырка, дурка, канка; шоры, индюшки вообще, но петух кан',
    'шоры': 'Шоры - 1) упряжь конская без хомута или оголовка, немецкая упряжь, со шлеей, с лямкой 2) конские наглазники, для пугливых лошадей; взяты с шорной упряжи. 3) тул. род бисерной поднизи, на висках и щеках, у женщин',
    'транс': 'Транс - 1) помрачение сознания с потерей самоконтроля; состояние отрешенности. 2) Особое усыпление, в которое впадает медиум во время спиритических опытов. 3) внезапно наступающее кратковременное расстройство сознания, во время которого больные совершают немотивированные поступки, стремительно бегут, бессвязно говорят и т. п.; отмечается гл. обр. при апилепсии; 4) ',
    'стать': 'Стать - 1) телосложение, осанка, фигура 2) суть, характер',
    'радон': 'Радон - 1) химический элемент с атомным номером 86, обозначается химическим символом Rn 2) радиоактивное простое вещество, состоящее из атомов радона [1]; при нормальных условиях тяжёлый инертный газ',
    'тать': 'Тать -  вор; Встарь, вор значило мошенник, своровать, смошенничать, сплутовать; а тать, прямое названье тайного похитителя',
    'стон': 'Стон - протяжный жалобный звук, издаваемый живым существом от сильной боли, страдания, горя, тоски, при тяжёлом душевном переживании и т. п',
    'сор': 'Сор - 1) мелкий мусор, пыль, грязь 2) что-либо ненужное, лишнее, являющееся помехой 3) солоноватое маловодное озеро',
    'талкан': 'Талкан - мука крупного помола из жареного ячменя или пшеницы',
    'умма': 'Умма - мусульманская община, объединенная верой в Аллаха и его посланника Пророка Мухаммада',
    'амбре': 'Амбре - 1) благовоние, приятный за́пах  2) духи́ с эссенцией амбры 3) неодобр. или ирон. сильный за́пах (обычно неприятный); зловоние ',
    'имаго': 'Имаго -  взрослая (дефинитивная) стадия индивидуального развития насекомых и некоторых других членистоногих животных со сложным жизненным циклом',
    'пери': 'Пери - 1) Доброе волшебное существо в образе прекрасной крылатой женщины, охраняющей людей от злых духов (в персидской мифологии). 2) Женщина пленительной красоты, чарующего обаяния.',
    'палета': 'Палета - транспортная тара, имеющая жёсткую площадку и место, достаточное для создания укрупнённой грузовой единицы',
    'паллета': 'Паллета - спекательная стальная или чугунная тележка с боковыми бортами и колосниками вместо дна',
    'перлит': 'Перлит - 1) горная порода вулканического происхождения, широко применяется в строительстве, различных отраслях промышленности, а также в садоводстве. Перлит, пропитанный глицерином, пропиленгликолем и ароматизатором, используется при курении кальяна вместо табака 2) одна из структурных составляющих стали и чугуна, представляющая собой смесь феррита и цементита; обладает большой прочностью и пластичностью;3) теплоизоляционный материал, получаемый обжигом кусков стекловатых вулканических пород (гл. обр. обсидиана); используется для получения легких заполнителей теплоизоляционных бетонов, материалов для изоляции печей, дымовых труб, трубопроводов и т. п. 4) Перловый камень; минерал с перламутровым блеском, серого и красного цветов, образовавшейся от действия вулканического огня на альбит и полевой шпат; находится в Венгрии, Италии и Мексике.',
    'прилет': 'Прилёт - 1) действие по гл. прилетать, прилететь 2) Появление перелетных птиц весной в местах их обитания',
    'прием': 'Приём -  1. действие по значению гл. принимать; взятие, получение какого-либо передаваемого объекта. 2. перен. отдельное движение в серии однородных действий, часть более сложного действия. 3. перен. особый способ выполнения какой-либо операции или сложного действия. 4. торжественное собрание с участием приглашённых лиц. 5. характер встречи, оказываемый кому-либо. 6. техн. качество связи; чёткость и разборчивость принимаемого сигнала.',
    'прана': 'Прана - в йоге, традиционной индийской медицине, эзотерике — представление о жизненной энергии, жизнь. В йоге считается, что прана пронизывает всю вселенную, хотя и невидима для глаз.',
    'пригон': 'Пригон - 1. Действие по гл. пригнать в 1 знач. - пригонять. Пригон скота. 2. То, что пригнано (с точки зрения его количества или качества). Большой пригон скота. 3. Место, куда пригоняют скот.',
    'зарод': 'Зарод - 1) продолговатый стог сена 2) Стог, скирда, кладь сена или хлеба (обычно продолговатой формы и большого размера).',
    'остуда': 'Остуда - 1) Охлаждение (в отношениях), гнев, размолвка, ссора. 2) холода, стужа',
    'кница': 'Кница - 1) Пень с толстым корнем 2) элемент конструкции корпуса судна, служащий гл. обр. для соединения отд. частей набора, располагающихся под углом одна к другой (напр., шпангоута с бимсом или флором, бортового стрингера с поперечной переборкой',
    'ранд': 'Ранд - денежная единица Южно-Африканской Республики',
    'рафинер': 'Рафинёр - в технике: аппарат для размола и очистки грубой древесной массы в бумажном производстве.',
    'иранка': 'Иранка - представительница иранцев',
    'фанерка': 'Фанерка - тонкая дощечка из лучшего дерева, идущая на сплошную оклейку и облицовку столярных изделий.',
    'отпад': 'Отпад - 1) Действие по гл. отпасть, отпадать. 2) мёртвые, остающиеся на корню растения (сухостой) и мёртвые органы, не отделившиеся от живых растений (стволы, сухие вершины, ветви, старика, сухие стебли и листья трав) ',
    'остол': 'Остол - на севере: шест для управления нартами ',
    'пилатес': 'Пилатес - разновидность фитнеса, разработанная в начале XX века Йозефом Пилатесом.',
    'под': 'Под - нижняя поверхность в печи (напр. русской), а также (в заводских печах) место, где нагревом, обжигом или плавлением обрабатываются изделия',
    'талиб': 'Талиб - 1) Исследователь; ученый; студент',
    'каретка': 'Каретка - подвижная, скользящая часть нек-рых машин, механизмов ',
    'шпажка': 'Шпажка - деревянная или пластиковая палочка (иногда со специально оформленными кончиками), используемая вместо десертных вилок.',
    'шаурма': 'Шаурма - горячая лепёшка (обычно — пита), в которую завёрнута начинка из курицы или иного мяса с добавлением салата из свежих овощей, с кетчупом, острыми приправами и т. п.',
    'узы': 'Узы - 1)  Цепи, оковы 2) То, что связывает, создает стеснение, гнет (книжн.). Борьба за освобождение от империалистических уз',
    'кулер': 'Кулер - 1) система охлаждения деталей компьютера, или, чаще всего, её часть — вентилятор 2) офисный или домашний аппарат для раздачи воды разной температуры (только холодной или ещё и горячей 3) в покере — раздача, в которой участвуют очень сильные комбинации и один или несколько игроков теряют много фишек',
    'амур': 'Амур - 1) В мифологии и поэзии божество любви, изображаемое в виде крылатого ребенка с луком и стрелами 2) Вид лучепёрых рыб семейства карповых 3) астр. один из околоземных астероидо',
    'слеток': 'Слеток - 1. охотн. молодая птица, только что начавшая вылетать из гнезда. 2. перен., разг., пренебр., устар. выскочк',
    'линек': 'Линек -  короткая веревка, с палец толщины, с узлом на конце. Служил для наказания матросов в старом флоте.',
    'отселение': 'Отселение - действие по значению гл. отселять, отселить.',
    'слоение': 'Слоение -  действие по значению гл. слоить.',
    'шато': 'Шато - французское название дворянской загородной усадьбы',
    'иол': 'Иол - 1) двухмачтовое парусное судно с косыми парусами и кормовой мачтой, установленной позади оси баллера руля (последним отличается от кеча) 2) Гребная канонерская лодка с одной носовой (кормовой) пушкой. 3) ',
    'коч': 'Коч - морское деревянное однопалубное одномачтовое парусно-гребное судно с малой осадкой (парус ставили при попутном ветре). Длина ок. 20 м, грузоподъемность до 30 т. Применялось на севере Руси в 16-17 вв.',
    'принт': 'Принт -  изображение (рисунок или фотография), нанесённое определённым способом на ткань, бумагу или другую поверхность',
    'кнель': 'Кнель - 1) разновидность фрикаделек из мясного или рыбного фарша (первоначально — из рублёного мяса или рыбы 2) жест, при котором пальцы одной руки прижимаются к вытянутой вниз другой руке в позиции между кистью и плечом',
    'кинез': 'Кинез - 1) в психологии: ненаправленная двигательная реакция (локомоторного или частного типа), при которой скорость движения зависит от интенсивности стимула, а не от направления его действия.',
    'ниша': 'Ниша - 1) Углубление в стене для помещения украшений (статуй, ваз), предметов мебели. 2) Углубление в скате горы, берега, траншеи, в лаве 3) Определённая, обычно ограниченная сфера какой-н. деятельности, возможность применения такой деятельности. Новое предприятие сумело найти свою ниш',
    'детва': 'Детва - личинки пчёл, а также молодые пчёлы',
    'аск': 'Аск - плодовая сумка (в ней развиваются аскоспоры) сумчатых грибов.',
    'тромп': 'Тромп (фр. trompe — охотничий рог, труба) — вогнутая поверхность в виде части конуса. Является конструктивным элементом, обеспечивающим переход от квадратного в плане средокрестия крестово-купольной постройки и четырёх подпружных арок к основанию цилиндрического барабана купола. Четыре тромпа по углам средокрестия обеспечивают перераспределение веса купола или башни: лантерны, тибуриума на угловые опоры. В арабской и испано-мавританской архитектуре тромпы оформляются в виде ступенчатых ниш и называются мукарнами, или «сталактитами». Тромпы впервые стали использовать в архитектуре древней Персии VIII—VI в. до н. э., а затем в Византии и Закавказье. В древнерусской архитектуре тромпы приобретали особую форму и назывались парусами',
    'моляр': 'Моляр - в стоматологии: шестые, седьмые и восьмые зубы постоянного зубного ряда с каждой стороны обеих челюстей у человека',
    'лимит': 'Лимит - 1) предельная величина; норма, в пределах которой разрешено пользоваться чем-либо, расходовать что-либо 2) Предельное значение, к которому стремится математическое выражение по мере известного изменения входящих в него величин',
    'пилот': 'Пилот - 1) Специалист, управляющий летательным аппаратом 2) Спортсмен, управляющий гоночным автомобилем',
    'мяло': 'Мяло - ',
    'кебаб': 'Кебаб - 1) Восточное блюдо. Кусочки мяса, овощей, фруктов, запеченные на вертеле в грилле 2) Небольшие куски мяса, которые жарят на вертеле вместе с кольцами лука. Это блюдо магометан. Его можно встретить также в Северной Африке и на Балканах. В Индии его обычно готовят из баранины, так как религиозные законы запрещают индусам употреблять в пищу говядину.',
    'калита': 'Калита - 1) устар. старин. старинное русское название денежной сумки, мешка, кошеля. 2) перен. рег. увелич., (на севере России) пирожок с картошкой или капустой с фигурно оформленным тестом',
    'ланка': 'Ланка - самка оленя',
    'асс': 'Асс - 1) единица монеты, веса и емкости у римлян. 2) старинный вес в Голландии, Германии и Швейцарии, одна из самых мелких частей фунта и марки',
    'кутас': 'Кутас - 1) Украшение в виде шнура с кистью на кивере 2) коровий ошейник с колокольчиком',
    'лаосец': 'Лаосец - гражданин, житель или уроженец Лаоса',
    'смена': 'Смена - 1) действие по значению гл. менять; изменение или замещение 2) промежуток времени, по истечении которого одна группа работающих на предприятии замещает другую 3) группа сотрудников, действующих в течение такого промежутка 4) тот, кто приходит, чтобы сменить, заместить другого 5) комплект периодически меняемой одежды 6) воен. процедура передачи охраняемого поста от одного часового (караульного) другому',
    'самец': 'Самец - репродуктивная особь мужского пола животного, производящая сперматозоиды',
    'начес': 'Начёс - 1) способ укладки волос, при котором пряди взбиваются на всю их толщину для придания пышности и объёма 2) длинный ворс на ткани и трикотажных изделиях 3) то, что заготовлено чесанием; начёсанное волокно, шерсть 4) место на коже, повреждённое чесанием',
    'мачо': 'Мачо - сильный, мужественный мужчина; квинтэссенция мужественности',
