    'малец': 'Малец - молодой парень, мальчик. Веселый малец',
    'сома': 'Сома - 1) мед. тело, туловище 2) мед. совокупность всех клеток организма, за исключением репродуктивных клеток 3) в древнеиндийской религии и мифологии священный дурманящий напиток, игравший важнейшую роль в обрядах жертвоприношений, а также божество этого напитка.---(от греч. soma - тело), все клетки животного или растения за исключением половых',
    'сало': '<p>Сало</p><ul><li>жировое отложение в теле животного организма</li><li>продовольственный продукт, получаемый из жировых веществ</li> <li>техн. смазочное вещество минерального или растительного происхождения </li> <li>ервичные ледяные образования, образующиеся на поверхности водоёмов при замерзании и состоящие из иглообразных и пластинчатых кристаллов в виде пятен или тонкого сплошного слоя серого цвета, шуга, мелкий лёд, ледяная кашица, или пропитанный водой снег на поверхности воды перед ледоставом, рекоставом</li> <li>спорт. место, откуда бьют и бросают мяч в игре в лапту, то же, что город, кон, межа, черта, грань, за которой са́лят</li></ul>',
    'сено': 'Сено - высушенные стебли и листья травянистых растений, скошенных в зелёном виде, до достижения ими полной естественной зрелости',
    'осел': 'Осёл - зоол. средних размеров непарнокопытное животное (лат. Equus asinus) из рода лошадей, с крупной мордой и длинными ушами',
    'лоно': '<p>Лоно</p><ul><li>поэт. то, что является прибежищем, приютом и т. п. для кого-либо, чего-либо </li> <li>устар церк.-слав. колени, грудь (обычно как символ нежности, материнства), а также чрево, утроба, пазуха</li> <li>недра или поверхность (воды, земли)</li><li>символ материнства, нежности, ласки</li></ul> ',
    'ленч': 'Ленч - Второй завтрак после полудня у англичан',
    'чал': 'Чал - 1) канат, трос, цепь для швартования судов 2) Причальный канат, цепь',
